import React from "react";

const Heading = () => {
  const logo = "https://image.flaticon.com/icons/svg/139/139899.svg";
  return (
    <div>
      <header className="App-header App-title">
        <img src={logo} className="App-logo" alt="logo" />
        CYF Hotel
      </header>
    </div>
  );
};
export default Heading;
